import React from 'react';
import {Link} from 'react-router-dom'



const Home = (props) => {
  return (
    <div>
      <Link to='/login'>Log In</Link>
      <br></br>
      <Link to='/signup'>Sign Up</Link>
      {
      	props.loggedInStatus ? <Link to='/logout' onClick= {handleClick}>Log Out</Link> :
      	null
      }
    </div>
  )
};


export default Home;
